description:
Verenigde Staten
Misdaad / Drama
107 minuten

goed

met James Marsden, Giovanni Ribisi en Dennis Hopper

Een lid van een straatbende uit Philadelphia raakt betrokken bij een maffia-afrekening. Wanneer hij de kans krijgt om zijn celstraf te ontlopen door bij het leger te gaan, bedenkt hij zich geen moment. Als hij terugkomt uit het leger merkt hij dat zijn broer in gevaar is. Om zijn broer te beschermen moet hij zich weer inlaten met de criminele elementen die ervoor gezorgd hebben dat hij bijna in de cel was beland.:
